(window.webpackJsonp=window.webpackJsonp||[]).push([[62],{87:function(e,t,n){"use strict";n.r(t);var a=n(0),o=function(e){var t,n,a,o,s,i,p,r=(t=void 0,n="新冠肺炎",a={},o="/tags/新冠肺炎",s=new Date(1689144734622),i={},p="post",a.type="page",a.internal=t,a.contentType="default",a.isTagPage=!0,a.layout="tag",a.permalink=o,a.slug=n,a.createdAt=s,a.updatedAt=s,a.posts=[i],a.pagination={hasPrev:!1,hasNext:!1,total:1,current:1,prevLink:"/tags/新冠肺炎/page/2",nextLink:t},a.tag=n,a.assets={},a.attributes=a,a.content=t,i.type=p,i.internal=t,i.contentType="markdown",i.slug="zhe-du-shen-me-shi",i.content=t,i.createdAt=new Date(15831936e5),i.updatedAt=new Date(1601188597815),i.title="这都什么事",i.layout=p,i.date="2020-03-03",i.categories=["过年"],i.tags=[n],i.featured_image="https://i.cssj.fun/usr/uploads/2019/08/le-creuset-m4ChAAL8E98-unsplash.png",i.description="在家休息了一个月的时间，本来想写点东西来，但一想还得从包里往出拿笔记本，还得开机。想想还是算了，床上多舒服。",i.markdownHeadings=[],i.excerpt="<p>受新冠肺炎影响，这次过年直接休了一个多月。本来年前还发愁，过年一共放的7天假，除去初一初二不拜年、初五不出门。剩下三天时间给七大姑八大姨的拜年，时间紧张的很。这下好嘛，年也不用拜了。本来之前都是拜年当天早上直接去买拜年的礼品的，今年还勤快了一下，年30的时候就准备好了。大年初一的时候就看到群里发的跟前好多地方开始广播、宣传，要进行出入管制，不能进入公共场合。本着及时止损的心态，我估计这年近期是拜不了，所以想着看这东西能不能退，毕竟都是有保质期的。当时买礼品的时候就顺手记了个老板的电话，这下用上了。也是抱着试一试的心态，把情况说明了，老板还挺好，答应给退了。万万没想到的是，第二天拉了一车过去以后，老板不答应退了。说好的诚信呢！！！我这暴脾气，真心忍不了。可又有什么办法呢，立场不同而已。</p>\n",i.permalink="/blog/zhe-du-shen-me-shi",i.assets={},i.attributes=i,i.tagsInfo=[{name:n,permalink:o}],i.categoriesInfo=[{name:"过年",permalink:"/categories/过年"}],a),u=e.options.beforeCreate||[];e.options.beforeCreate=[function(){this.$page=r}].concat(u);["layout","transition"].forEach((function(t){var n=e.options.PageComponent;n&&(e.options[t]=n[t]),void 0===e.options[t]&&(e.options[t]=r[t])})),r.slug&&(e.options.name="page-wrapper-"+r.slug.replace(/[^0-9a-z\-]/gi,"-"))},s=Object(a.a)({},(function(){var e=this.$createElement;return(this._self._c||e)("layout-manager")}),[],!1,null,null,null);"function"==typeof o&&o(s);t.default=s.exports}}]);